import React, { useState } from 'react';
import axios from 'axios';

function Register() {
  const [formData, setFormData] = useState({
    name: '', email: '', phone: '', age: '', gender: '', destination: '', package: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5001/api/users/register', formData);
      alert(res.data.message);
    } catch (error) {
      alert(error.response.data.message);
    }
  };

  return (
    <div className="registration">
      <h1>Register Here</h1>
      <form onSubmit={handleSubmit}>
        <input type="text" name="name" placeholder="Name" onChange={handleChange} required />
        <input type="email" name="email" placeholder="Email" onChange={handleChange} required />
        <input type="tel" name="phone" placeholder="Phone" onChange={handleChange} required />
        <input type="number" name="age" placeholder="Age" onChange={handleChange} required />
        <select name="gender" onChange={handleChange} required>
          <option value="">Select Gender</option>
          <option value="Male">Male</option>
          <option value="Female">Female</option>
        </select>
        <select name="destination" onChange={handleChange} required>
          <option value="">Select Destination</option>
          <option value="Kashmir">Kashmir</option>
          <option value="Istanbul">Istanbul</option>
          {/* Add other destinations */}
        </select>
        <select name="package" onChange={handleChange} required>
          <option value="">Select Package</option>
          <option value="Bronze">Bronze</option>
          <option value="Silver">Silver</option>
          {/* Add other packages */}
        </select>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default Register;
